def prediction_verfied_CDF(WEB):
    import collections
    _max = max(len(WEB[i]) for i in WEB)
    total = 766
    ct = collections.defaultdict(int)
    for i in range(0,766,1):
        if str(i) not in WEB:
            ct[0] += 1
        else:
            s = len(WEB[str(i)])
            ct[s] += 1
    _cum = 0
    for i in range(_max+1):
        if i in ct:
            _cum += ct[i]
        print ("{} {} {}".format(i,i,float(_cum)/total))

